const GalleryList = ({ pictures }) => (
  <ul>
    {articles.map(({ objectID, url, title }) => (
      <li key={objectID}>
        <a href={url} target="_blank" rel="noreferrer noopener">
          {title}
        </a>
      </li>
    ))}
  </ul>
);

export const App = () => {
  return (
    <>
      <SearchBar />
      <ImageGallery />
    </>
  );
};
